@Override
    public AddonSpecification select(Set<AddonSpecification> addons) {
	TreeSet<AddonSpecification> specs = new TreeSet<>(new VersionComparator());
	for (AddonSpecification spec : addons) {
	    specs.add(spec);
	}
	return specs.last();
